import { NavLink } from "react-router-dom";

const Nav = () => {
  return (
    <nav>
      <NavLink to="/">Both Sexes study</NavLink>
      <NavLink to="/female">Female Sexes study</NavLink>
      <NavLink to="/male">Male study</NavLink>
    </nav>
  );
};
export default Nav;
